import React from 'react';
import styles from './FoodDrink.module.css';

import Food from './Food';

export default function FoodDrink(props) {

  return (
    <div>
      

      {
        props.items.map(item => <Food key={item.id} {...item} />)
        
      }
    </div>
  )
}
